import React from "react";
import { projects_data } from "./projects_data";
import ProjectTile from "./ProjectTile";


export default function Projects() {

    return (
        <section id="projects" className="main-content">
            <div id="work-section-title" className="section-title">
                <h2>My recent works</h2>
            </div>
            <div id="projects-main-container">
                {projects_data.map(proj => <ProjectTile data={proj} />)}

                <div id="more-btn-container">
                    <a href="https://github.com/FooLeeSze" target="_blank" id="more-btn">See more</a>
                </div>
            </div>
        </section>
    )
}
